import './App.css';

import React, { createContext, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

// --- Contexts ---
export const AuthContext = createContext();
export const UserContext = createContext();
export const PetContext = createContext();

// --- Components Inline ---
function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <Link className="navbar-brand" to="/">Meu Projeto</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/login">Login</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/register">Register</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

function Footer() {
  return (
    <footer className="bg-light text-center text-lg-start mt-5">
      <div className="text-center p-3">
        © 2025 Meu Projeto | Desenvolvido por Bruno
      </div>
    </footer>
  );
}

// --- Pages Simples ---
function Home() {
  return (
    <div className="container mt-4">
      <h2>Home</h2>
      <p>Bem-vindo à página inicial!</p>
    </div>
  );
}

function Login() {
  return (
    <div className="container mt-4">
      <h2>Login</h2>
      <p>Faça seu login para acessar o sistema.</p>
    </div>
  );
}

function Register() {
  return (
    <div className="container mt-4">
      <h2>Register</h2>
      <p>Cadastre-se para começar a usar.</p>
    </div>
  );
}

// --- App Principal ---
function App() {
  const [auth, setAuth] = useState({ loggedIn: false, user: null });
  const [user, setUser] = useState({ name: 'Bruno', email: 'bruno@email.com' });
  const [pets, setPets] = useState([{ id: 1, name: 'Rex' }, { id: 2, name: 'Mimi' }]);

  return (
    <AuthContext.Provider value={{ auth, setAuth }}>
      <UserContext.Provider value={{ user, setUser }}>
        <PetContext.Provider value={{ pets, setPets }}>
          <Router>
            <Navbar />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Routes>
            <Footer />
          </Router>
        </PetContext.Provider>
      </UserContext.Provider>
    </AuthContext.Provider>
  );
}

export default App;
